import React, { useEffect, useState } from 'react'
import {
  HistoryList
} from './HistoryList'
import { useDispatch, useSelector, shallowEqual } from 'react-redux'
import { actions } from './redux/AccountRedux'
import { ComputerModel, HistoryModel } from 'app/modules/history/models/Account'
import { RootState } from 'setup'
import { ComputerList } from './ComputerList'
import { StaticList } from './StaticList'


const AccountPage: React.FC = () => {
  const dispatch = useDispatch()
  //const histories: HistoryModel[] = useSelector<RootState>(({ histories }) => histories.histories, shallowEqual) as HistoryModel[] || []
  const computers: ComputerModel[] = useSelector<RootState>(({ histories }) => histories.computers, shallowEqual) as ComputerModel[] || []

  useEffect(() => {
    dispatch(actions.requestHistories(1))
    dispatch(actions.requestComputers())


  }, [])

  return (
    <>
      <div className='row gy-5 gx-xl-12'>
        <div className='col-xl-12'>
          <ComputerList computers={computers} className='card-xxl-stretch mb-5 mb-xl-12' />
        </div>
      </div>
    </>
  )
}
export default AccountPage
